CREATE TABLE `rc_card_data` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `card_prefix` bigint(20) NOT NULL DEFAULT '0' COMMENT '卡号前缀(包含地区码)',
  `card_length` int(11) NOT NULL DEFAULT '0' COMMENT '卡号长度',
  `card_name` varchar(50) NOT NULL DEFAULT '' COMMENT '卡名',
  `card_type` int(11) NOT NULL DEFAULT '0' COMMENT '银行卡类型: 0:借记卡、1:贷记卡、2:准贷记卡、3:预付费卡',
